import React, { Component } from 'react'
import { MaterializeCSS } from './../../utils/Util'
import { countryModule } from './../../services/countryService'

export class countryDropDown extends Component {
    constructor(props) {

        super(props)
    
        this.state = {
             countryList:[]
        }
    }

    componentWillMount = async ()=>{
        console.log('in will')
    //     //MaterializeCSS.AutoInit()
        // const countryList = await countryModule.getCountry()
        // console.log(countryList)
        // this.setState({countryList:countryList})
    }

    componentDidMount = async ()=>{
        console.log('in did')
        const countryList = await countryModule.getCountry()
        console.log(countryList)
        this.setState({countryList:countryList})
    }
    
    render() {
        console.log('indropdown')
        if(!Object.keys(this.state.countryList).length){
            return (
                <div className="input-field col s4">
                            
                            <select>
  <option value="volvo">Volvo</option>
  <option value="saab">Saab</option>
  <option value="mercedes">Mercedes</option>
  <option value="audi">Audi</option>
</select>
    
    
</div>
            );
        }
        return (
            <div className="input-field col s4">
                            
            <select>
<option value="volvo">Volvo</option>
<option value="saab">Saab</option>
<option value="mercedes">Mercedes</option>
<option value="audi">Audi</option>
</select>


</div>
        )
    }
}

export default countryDropDown
